import { makeStyles } from '@material-ui/core/styles';
import { deepPurple } from '@material-ui/core/colors';

export default makeStyles((theme) => ({
  appBar: {
    borderRadius: 15,
    margin: '30px 0',
    display: 'flex',
    flexDirection: 'row',
    justifyContent: 'space-between',
    alignItems: 'center',
    padding: '10px 50px',
    // backgroundColor: '#000022',
    backgroundColor: '#0f0f0f',
  },
  heading: {
    color: 'white',
    marginLeft: '10px',
    textDecoration: 'none',
  },
  image: {
    marginLeft: '15px',
  },
  toolbar: {
    display: 'flex',
    justifyContent: 'flex-end',
    width: 'fit-content',
  },
  profile: {
    display: 'flex',
    justifyContent: 'space-between',
    width: 'fit-content',
  },
  userName: {
    display: 'flex',
    alignItems: 'center',
    color: 'white',
    marginLeft: '30px',
    marginRight: '30px',
  },
  brandContainer: {
    display: 'flex',
    alignItems: 'center',
  },
  purple: {
    color: theme.palette.getContrastText(deepPurple[500]),
    backgroundColor: deepPurple[500],
  },
}));
